import iris
import os
import sys
from pipeline import pipeline

# Login Info
username = "demo"
password = "demo"
hostname = os.getenv("IRIS_HOSTNAME", "localhost")
port = 1972
namespace = "USER"
CONNECTION_STRING = f"{hostname}:{port}/{namespace}"

connection = None
cursor = None

# Table info
table_name = "HackTXSour.SavedObjects"
table_definition = "(type VARCHAR(255), fname VARCHAR(255), lname VARCHAR(255), img_vector VECTOR(DOUBLE, 2048))"
object_type = "face"

def remove_table():
    try:
        cursor.execute(f"DROP TABLE {table_name}")
    except:
        print("Could not remove table (likely does not exist).", file=sys.stderr)

def connect():
    global connection
    global cursor
    try:
        connection = iris.connect(CONNECTION_STRING, username, password)
        cursor = connection.cursor()
    except:
        print("Error when connecting to server.", file=sys.stderr)

def create_empty_table(reset):
    try:
        cursor.execute(f"CREATE TABLE {table_name} {table_definition}")
    except Exception as e:
        if reset:
            remove_table()
            cursor.execute(f"CREATE TABLE {table_name} {table_definition}")
        else:
            # print(f"An error occurred: {e}", file=sys.stderr)
            pass


def server_setup(reset=False):
    connect()
    create_empty_table(reset)


def add_face(fname : str, lname : str, base64_str : str):
    vector = None
    try:
        vector, _ = pipeline(base64_str)
    except Exception as e:
        print(e, file=sys.stderr)
        return None
    
    sql = f"INSERT INTO {table_name} (type, fname, lname, img_vector) values (?, ?, ?, TO_VECTOR(?))"
    data = (object_type, fname, lname, str(vector))
    cursor.execute(sql, data)

def search_face(base64_str: str, num_results=1):
    vector = None
    try:
        vector, _ = pipeline(base64_str)
    except Exception as e:
        print(e, file=sys.stderr)
        return None

    sql = f"""
        SELECT TOP ? fname, lname
        FROM {table_name}
        ORDER BY VECTOR_COSINE(img_vector, TO_VECTOR(?)) DESC
    """

    cursor.execute(sql, [num_results, str(vector)])
    return cursor.fetchall()

